2.1 O Fórum Nacional de Trabalhadoras e Trabalhadores do SUAS (Sistema Único de Assistência Social) tem um papel fundamental na construção e no fortalecimento das políticas públicas de assistência social no Brasil. Seguindo orientação do Despacho nº 1918567/2024/06-SEC/06-DIRET do processo SEI nº 570600321.001186/2024-25, o setor de Eventos está incumbido de organizar o serviço de buffet para o evento que terá capacidade para 100 pessoas presenciais. Ressaltamos que este evento será um "espaço para reflexão e compartilhamento de experiências, saberes e práticas da Psicologia na Política Pública de Assistência Social, fortalecendo seus trabalhadores para uma política de reconstrução do SUAS com a perspectiva da garantia dos direitos socioassistenciais constitucionais, especialmente neste momento em que há aumento das vulnerabilidades sociais e desproteções, além de um cenário de retirada dos direitos sociais.

2.2 Sendo atividade de longa duração, faz-se necessário oferecer às participantes, durante sua presença, a alimentação, de maneira a garantir presença durante evento;

2.3 A contratação de lanche é necessária para garantir a alimentação das participantes previamente inscritas para participação do X Seminário Nacional de Trabalhadoras/es do SUAS e XI Plenária Nacional do FNTSUAS;

2.4 A não aquisição da contratação frustrará o compromisso assumido por este Conselho Regional junto à Coordenação Colegiada do FETSUAS SP.

2.5 Não há contratações interdependentes.

